import React from 'react';
import Rating from 'material-ui-rating';

class PersonRates extends React.Component{
  render(){
    return(
      <div>
      <Rating

         value={this.props.value}
         max={5}
         onChange={(i) => console.log('onChange ' + i)}
       />
      </div>

    )
  }
}


export default PersonRates
